// import React from 'react';
import './header.css';
export default Header;

function Header() {
    return (
        <header className="header">
            <img src="Logo format PNG\Logo en couleur\LOGO S_LOGO S.png" alt="Company Logo" className="logo" />
            <nav>
                <ul>
                    <li><a href="/">Notre mission</a></li>
                    <li><a href="/about">Nos sacs</a></li>
                    <li><a href="/services">Impacts</a></li>
                    <li><a href="/contact"></a></li>
                </ul>
            </nav>
        </header>
    );
}
